      <>
        <div className="container">
          <div className="header-container">
          <ul className="category-list">
            {categories.map((item) => (
              <li key={item.name} className="category-list-cell">
                {item.name}
              </li>
            ))}
          </ul>
          </div>
          <div className="header-container"><a>logo</a></div>

          <div className="header-container">
            <a>curr</a>
            <a>cart</a>
          </div>
        </div>
